erfaz',NULL),(3168,1,26,336,'Al no encontrar rapidamente la opcion para ajustar la interfaz fue bastante frustrante finalizar la tarea. Usualmente en esa instancia el usuario abandona la pagina.',NULL),(3169,2,8,336,'La busqueda resulto efectiva solamente al ingresar el nombre completo de la obra. Usualmente se espera que la busqueda sea con informacion mas vagamente especificada, algo como \'chica tren\' o \'chica en el tren\' deberia de poder retornar el mismo resultado que ingresar el titulo exacto de la busqueda.',NULL),(3170,4,9,336,'Recibi informacion de que el sistema estaba procesando mi pedido y cuando agregue exitosamente el item al carrito recibi una informacion de que la operacion se efectuo exitosamente',NULL),(3171,1,10,336,'Al no ingresar exactamente el titulo de la obra buscada se espera que el sistema pueda sugerir posibles opciones relacionadas a la busqueda, como titulos que contengan las palabras buscadas',NULL),(3172,2,11,336,'Mas informacion de las operaciones y ayuda en cada pantalla permitiria que un usuario primerizo pueda ubicarse mejor, ademas de ubicar opciones de configuracion en la parte superior para facilitar su uso',NULL),(3173,4,12,336,'No necesariamente complejo, mas necesita que las opciones esten mejor ubicadas, usualmente la ayuda y las  configuraciones se buscan en la parte superior',NULL),(3174,2,13,336,'La cuestion del tamanho de fuente por default hizo que se volviera bastante tedioso el usar el sistema. Si es costoso de leer ya inicialmente y no se encuentra rapidamente las opciones para ajustar el sitio se abandona inmediatamente',NULL),(3175,4,14,336,'No necesariamente tecnica, pero al menos el de una persona que ya haya utilizado el mismo servicio y que pueda aclarar las dudas que surgen a medida que se interactua con el sistema',NULL),(3176,3,15,336,'El ajuste de la interfaz y la busqueda hacen que el sistema sea menos atractivo.\r\nPero las informaciones mostradas al realizar una operacion como \'agregar al carrito\' y \'realizando busqueda\' permiten que el usuario sepa que el sistema esta procesando su pedido.',NULL),(3177,1,16,336,'Cuando el sistema respondia que esaba actuando me transmitio la confianza de que estaba realizando su labor.',NULL),(3178,2,17,336,'Al no estar 100% seguro de que lo que esta realizando el usuario, como al cancelar un pedido, lo mas probable que suceda es que el este no quiera usar el sistema',NULL),(3179,5,18,336,'Mejorar la interfaz seria fundamental, si el usuario no tiene la paciencia para ajustar el sitio lo abandona inmediatamente. Si no tiene certeza de que sus acciones se estan realizando tambien.',NULL),(3180,2,19,336,'Cuando el sistema no retorna mensajes de \'Operacion exitosa\' o \'Cancelacion confirmada\' el usuario no tiene manera de saber si su pedido se proceso adecuadamente, sumando a las dudas que usualmente uno tiene al usar un sistema por primera vez llevan a la conclusion de que el sistema no es confiable, por tanto no lo utilizara',NULL),(3181,2,20,336,'Se necesita tener una idea al menos general de lo que se esta intentando hacer para iniciar. Alguien que nunca realizo una compra por internet probablemente desistiria en el intento.',NULL),(3182,NULL,NULL,336,NULL,'Cuando el sistema no ofrece informaciones de su estado o ayuda del tipo \'como hacer [...]\' invita al usuario a tener mas dudas o directamente frustarse lo que lleva al abandono del sistema.<br>En una situacion real al no poder ajustar la interfaz ya inmediatamente habria abandonado el sitio.<br>Las tareas y los cuestionarios estaban muy bien explicados, concisos y simples, faciles de seguir.<br>'),(3183,1,5,337,'no lo pude hacer',NULL),(3184,1,21,337,'',NULL),(3185,1,22,337,'',NULL),(3186,4,1,337,'',NULL),(3187,5,2,337,'',NULL),(3188,2,3,337,'falta que este mas visible, algun icono que llame mas la atencion o que vaya acorde con esto',NULL),(3189,2,26,337,'',NULL),(3190,5,8,337,'',NULL),(3191,3,9,337,'',NULL),(3192,2,10,337,'',NULL),(3193,3,11,337,'',NULL),(3194,2,