2,3,13,546,'',NULL),(6313,2,14,546,'',NULL),(6314,3,15,546,'',NULL),(6315,2,16,546,'',NULL),(6316,3,17,546,'',NULL),(6317,2,18,546,'',NULL),(6318,2,19,546,'',NULL),(6319,2,20,546,'',NULL),(6320,NULL,NULL,546,NULL,'La verdad no entiendo para que hacen esto. Pero tuve ganas de realizar el \"experimento\" los primeros 2 minutos. Luego me pareció aburrido continuar con los cuestionarios. Pero les animo a que sigan intentandolo o a ir mejorando cada vez. Les falto un poco mas de orden a su pagina web de compras online. Las letras, el tamaño, los colores, no la hacian tan llamativa que digamos.'),(6321,3,5,550,'Al dar clic en el botón \"validar\", no reaccionaba, hasta probar varias veces y luego valido, pero al cancelar he presionado varias veces el botón y el sitio no se ha actualizado.',NULL),(6322,3,21,550,'No sé si el sitio no funciono bien solo para mi, porque tuve algunos inconvenientes y mencionados en el comentario anterior.',NULL),(6323,3,22,550,'El sistema es bastante interactivo, se comprende y se interpreta bien, tiene una interfaz bastante flexible para que aquella persona que tiene su primera experiencia comprando vía Internet pueda sentirse cómoda, es por ello que no estoy en desacuerdo a pesar de los pequeños inconvenientes que he tenido.',NULL),(6324,4,1,550,'No totalmente de acuerdp, ya que solo pude encontrar para ajustar el tamaño de las letras de los articulos y la parte central del sitio, el de la barra de \"herramientas\" del margen derecho no pude ajustar. ',NULL),(6325,4,2,550,'Debido a que no pude ajustar el tamaño de la letra de la barra de herramientas del margen derecho no pude encontrar con mayor rapidez el sitio para obtener información acerca de devoluciones.',NULL),(6326,4,3,550,'Si tan solo podría haber ajustado el tamaño de letra de esa parte de la pagina, creo que seria mucho mas sencillo y más rápido.',NULL),(6327,4,26,550,'Como lo he mencionado con anterioridad, solo pude modificar el tamaño y tipo de letra de la parte central del sitio (Donde se exponen los artículos y demás)',NULL),(6328,5,8,550,'Esta vez todo el sitio pudo verse con claridad (incluyendo la barra de herramientas)',NULL),(6329,5,9,550,'Excelente esta parte, es importante que el sitio tire mensajes al usuario mencionando que se esta realizando la búsqueda o acción que él ha producido',NULL),(6330,5,10,550,'',NULL),(6331,5,11,550,'Es una opción, no uso con frecuencias los sitios para realizar compras en Internet, pero es una muy buena opción',NULL),(6332,1,12,550,'',NULL),(6333,4,13,550,'Es bastante fácil, flexible, eficaz. Ideal para aquel usuario que experimenta esto por primera vez',NULL),(6334,1,14,550,'',NULL),(6335,4,15,550,'',NULL),(6336,1,16,550,'',NULL),(6337,5,17,550,'',NULL),(6338,1,18,550,'',NULL),(6339,5,19,550,'',NULL),(6340,1,20,550,'No, como mencione anteriormente, es la primera vez que ingreso a una tienda online y me sentí bastante cómodo ',NULL),(6341,NULL,NULL,550,NULL,'Realmente el trabajo es admirable, no me imagino las horas que has invertido desarrollando este sistema y ante todo quiero felicitarte, lo que estas realizando es digno de admirar, imitar y por sobre todo para nosotros que iniciamos, sobrepasar y mejorar el día de mañana lo que has creado.<div>Y para culminar, pedirte disculpas si encuentras comentarios absurdos en tus formularios (respecto a los inconvenientes que se me presentaron) pudo haber sido algún error de mi computadora o algo así. </div><div>Saludos</div><div>Jorge Agüero</div>'),(6342,4,5,551,'',NULL),(6343,4,21,551,'',NULL),(6344,5,22,551,'',NULL),(6345,4,1,551,'',NULL),(6346,2,2,551,'',NULL),(6347,4,3,551,'',NULL),(6348,4,26,551,'',NULL),(6349,5,8,551,'',NULL),(6350,4,9,551,'',NULL),(6351,4,10,551,'',NULL),(6352,4,11,551,'',NULL),(6353,4,12,551,'',NULL),(6354,3,13,551,'',NULL),(6355,4,14,551,'',NULL),(6356,4,15,551,'',NULL),(6357,2,16,551,'',NULL),(6358,3,17,551,'',NULL),(6359,3,18,551,'',NULL),(6360,4,19,551,'',NULL),(6361,4,20,551,'',NULL),(6362,NULL,NULL,551,NULL,'Fue útil en g