e-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">que protegen la escuela, dos alumnos son brutalmente atacados. Dumbledore sabe que se acerca el momento, anunciado por la Profecía, en que Harry Potter y Voldemort se enfrentarán a muerte: «El único con poder para vencer al Señor Tenebroso se acerca... Uno de los dos debe morir a manos del otro, pues ninguno de los dos podrá vivir mientras siga el otro con vida.». El anciano director solicitará la ayuda de Harry y juntos emprenderán peligrosos viajes para intentar debilitar al enemigo, para lo cual el joven mago contará con la ayuda de un viejo libro de pociones perteneciente a un misterioso príncipe, alguien que se hace llamar Príncipe Mestizo.</span><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><br></span></div><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><ul class=\"list07\" style=\"outline: none; list-style: none; margin: 0px; padding: 0px; font-size: 0.917em; line-height: 15px; word-spacing: 0px;\"><li class=\"first-child\" style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Nº de páginas:</span> 608 págs.</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: none; color: rgb(179, 178, 178);\">Encuadernación:</span> Tapa blanda</li><li style=\"outline: none; margin: 0px; padding: 0px 0px 2px; line-height: 1.2em; background: none;\"><span class=\"light\" style=\"outline: 