con la ayuda de sus fieles amigos Ron y Hermione, es capaz de todo y mucho más.</span>',0,'HARRY POTTER Y EL PRISIONERO DE AZKABAN ',0,35,9,'J.K. ROWLING , S.A.) SALAMANDRA (PUBLICACIONES Y EDICIONES SALAMANDRA, 2011','harry-potter-y-el-prisionero-de-azkaban-'),(38,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Igual que en las dos primeras partes de la serie, Harry aguarda con impaciencia el inicio del tercer curso en el Colegio Hogwarts de Magia. Tras haber cumplido los trece años, solo y lejos de sus amigos, Harry se pelea con su bigotuda tía Marge, a la que convierte en globo, y debe huir en un autobús mágico. Mientras tanto,&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">de la prisión de Azkaban se ha escapado un terrible villano, Sirius Black, un asesino en serie con poderes mágicos que fue cómplice de lord Voldemort y que parece dispuesto a borrar a Harry del mapa. Y por si esto fuera poco, Harry deberá enfrentarse también a unos terribles monstruos, los dementores, seres abominables capaces de robarles la felicidad a los magos y de eliminar todo recuerdo hermoso de aquellos que osan mirarlos. Lo que ninguno de estos malvados personajes sabe es que Harry, con la ayuda de sus fieles amigos Ron y Hermione, es capaz de todo y mucho más.</span>',0,'HARRY POTTER Y EL PRISIONERO DE AZKABAN ',0,35,9,'J.K. ROWLING , S.A.) SALAMANDRA (PUBLICACIONES Y EDICIONES SALAMANDRA, 2011',NULL),(39,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Tras otro abominable verano con los Dursley, Harry se dispone a iniciar el cuarto curso en Hogwarts, la famosa escuela de magia y hechicería. A sus catorce años, a Harry le gustaría ser un joven mago como los demás y dedicarse a aprender nuevos sortilegios, encontrarse con sus amigos Ron y Hermione y asistir con ellos a los&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Mundiales de quidditch. Sin embargo, al llegar al colegio le espera una gran sorpresa que lo obligará a enfrentarse a los desafíos más temibles de toda su vida. Si logra superarlos, habrá demostrado que ya no es un niño y que está preparado para vivir las nuevas y emocionantes experiencias que el futuro le depara.</span><span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">&nbsp;</span>',0,'HARRY POTTER Y EL CALIZ DE FUEGO ',0,44,9,'J.K. ROWLING , S.A.) SALAMANDRA (PUBLICACIONES Y EDICIONES SALAMANDRA, 2011','harry-potter-y-el-caliz-de-fuego-'),(40,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y el insoportable primo Dudley. Harry se siente muy triste y solo, hasta que un buen día recibe una carta que cambiará su vida para siempre. En ella le comunican que ha sido aceptado como alumno en el Colegio Hogwarts de Magia. A partir de ese moment&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">o, la suerte de Harry da un vuelco espectacular. En esa escuela tan especial aprenderá encantamientos, trucos fabulosos y tácticas de defensa contra las malas artes. Se convertirá en el campeón escolar de quidditch, especie de fútbol aéreo que se juega montado sobre escobas, y hará un puñado de buenos amigos... aunque también algunos temibles enemigos. Pero, sobre todo, conocerá los secretos que le permitirán cumplir con su destino. Pues, aunque no lo parezca a primera vista, Harry no es un chico normal y corriente: ¡es un verdadero mago!</span>',0,'HARRY POTTER Y LA PIEDRA FILOSOFAL',0,33,9,'J.K. ROWLING; JOANNE K. ROWLING , S.A.) SALAMANDRA (PUBLICACIONES Y EDICIONES ','harry-potter-y-la-piedra-filosofal'),(41,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Harry Potter tiene que realizar una tarea siniestra, peligrosa y aparentemente imposible: el de localizar y de destruir a Horcruxes. Harry nunca se sintió tan sólo ni se enfrentó a un futuro tan incierto. Pero Harry Potter debe encontrar la fuerza necesaria para terminar la tarea que le han dado. Él debe dejar el calor, la&nbsp;</span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">seguridad y el compañerismo de La Madriguera y seguir sin miedo el camino inexorable marcado para él. En este final, la séptima entrega de la serie Harry Potter, J.K. Rowling revela de manera espectacular las respuestas a las muchas preguntas que se han estado esperando con tanta impaciencia. Su rica prosa y su narrativa, llena de giros inesperados, han hecho que estos libros sean libro para leer y releer una y otra vez.</span><span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">&nbsp;</span>',0,'HARRY POTTER Y LAS RELIQUIAS DE LA MUERTE',0,36,9,'J.K. ROWLING , S.A.) SALAMANDRA (PUBLICACIONES Y EDICIONES SALAMANDRA, 2011','harry-potter-y-las-reliquias-de-la-muerte'),(42,'<span style=\"color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">Las tediosas vacaciones en casa de sus tíos todavía no han acabado y Harry Potter se encuentra más inquieto que nunca. Apenas ha tenido nocitias de Ron y Hermiones, y presiente que algo extraño está sucediendo en Hogwarts. En efecto, cuando por fin comienza otro curso en el famoso colegio de magia y hechicería, sus temores </span><span id=\"sinopsis\" class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\">se vuelven realidad. El Ministerio de Magia niega que Voldemort haya regresado y ha iniciado una campaña de desprestigio contra Harry Pottery Dumbledore, para lo cual ha asignado a la horrible profesora Dolores Umbridge la tarea de vigilar todos sus movimientos. Así pues, además de sentirse solo e incomprendido, Harry sospecha que Voldemort puede adivinar sus pensamientos, e intuye que el temible mago trata de apoderarse de un objeto secreto que le permitiría recuperar su poder destructivo.</span><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 17.65px; word-spacing: 4px; background-color: rgb(255, 255, 255);\"><br></span></div><div><span class=\"expand-content expand-hide\" style=\"outline: none; display: inline; color: rgb(83, 83, 83); font-family: Aria